pragma solidity >= 0.5.0 < 0.7.0;
contract realestate{

struct plot{

	// State variables are fr_id,crime_no....etc sol filename is medrecords 
	uint plot_id;
	uint aadharam_id;
	uint user_id;
	string acent;
	string status;

}

struct aadharam{

	// State variables are fr_id,crime_no....etc sol filename is medrecords 
	uint aadharam_id;
	uint district_id;
	uint panchayath_id;
	string cent;
	string details;
	string location;
	string files;
	string status;

}


struct users{

	// State variables are fr_id,crime_no....etc sol filename is medrecords 

	uint user_id;
	uint login_id;
	string fname;
	string lname;
	string phone;
	string email;
	string photo;
	string addresss;
	string gender;

}





plot []fr;
aadharam []fa;
users []us;



function add_plot(uint plot_id,
	uint aadharam_id,
	uint user_id,
	string memory acent,
	string memory status
	)
	public
	{
	plot memory f1=plot(plot_id,aadharam_id,user_id,acent,status);
	fr.push(f1);
	}




function add_aadharam(uint aadharam_id,

	uint district_id,
	uint panchayath_id,
	string memory cent,
	string memory details,
	string memory location,
	string memory files,
	string memory status
				)

	public
	{
	aadharam memory f3=aadharam(aadharam_id,district_id,panchayath_id,cent,details,location,files,status);
	fa.push(f3);
	}		

function add_users(
   uint user_id,
	uint login_id,
	string memory fname,
	string memory lname,
	string memory phone,
	string memory email,
	string memory photo,
	string memory addresss,
	string memory gender

				)

	public
	{
		users memory f4=users(user_id,login_id,fname,lname,phone,email,photo,addresss,gender);
		us.push(f4);
	}			

}
